import { Link } from 'react-router-dom';
import delmonte from '../assets/delmonte.svg';
import './styles.css';

export const Home = () => {
    return(
        <div className="home">
            <div className='logo'>
                <img src={delmonte}/>
            </div>
            <h1>Welcome to Hyperledger Demo</h1>
            <div>
            <Link to="/producer">Producer</Link>
            <Link to="/manufacturer">Manufacturer</Link>
            <Link to="/deliverer">Deliverer</Link>
            <Link to="/sushi">Sushi</Link>
            <Link to="/retailer">Retailer</Link>
            </div>
        </div>
    )
}
